INSERT INTO `books` (`book_isbn`, `book_title`, `book_author`, `book_image`, `book_desc`, `book_price`, `book_qty`, `genre_id`) VALUES
(1, 'The Lost Symbol', 'Dan Brown', 'lost_symbol.jpg', 'The Lost Symbol is a book of the series from dan brown novels where protagonist is Robert Langdon who tries to save his friend peter solomon', 1200, 0, 1),
(2, 'Pride and Prejudice', 'Jane Austen', 'PridenPreju.jpg', 'Pride and Prejudice is a romantic novel of manners written by Jane Austen in 1813. The novel follows the character development of Elizabeth Bennet, the dynamic protagonist of the book who learns about the repercussions of hasty judgments and comes to appreciate the difference between superficial goodness and actual goodness. Its humour lies in its honest depiction of manners, education, marriage, and money during the Regency era in Great Britain.', 1000, 4, 2),
(3, 'Life Of Pi', 'Yann Martel', 'LifeOfPi.jpg', 'Life of Pi is a Canadian philosophical novel by Yann Martel published in 2001. The protagonist is Piscine Molitor \"Pi\" Patel, an Indian Tamil boy from Pondicherry who explores issues of spirituality and metaphysics from an early age. He survives 227 days after a shipwreck while stranded on a lifeboat in the Pacific Ocean with a Bengal tiger which raises questions about the nature of reality and how it is perceived and told.', 700, 5, 3),
(4, 'Little Women', 'Louisa May Alcott', 'LittleWomen.jpg', 'Louisa May Alcott’s treasured classic, Little Women, vividly presents the story of four March sisters and their mother, Marmee. The complexities and tribulations faced by these young women, while they are growing up during the American Civil War have been realistically portrayed in the novel. The novel revolves around the personal ambitions of the beautiful Meg, aspiring writer Jo, frail Beth and pampered Amy and chronicles the transformation of its characters from beings young girls to becoming women. Originally published in two volumes in 1868 and 1869, Little Woman was an immediate commercial success and has been widely read and adapted.', 1700, 1, 2),
(5, 'Archie\'s Comic', 'Vic Bloom', 'Archies.png', 'Archie Comic Publications, Inc., is an American comic book publisher headquartered in Pelham, New York.[3] The company\'s many titles feature the fictional teenagers Archie Andrews, Jughead Jones, Betty Cooper, Veronica Lodge, Reggie Mantle, Sabrina Spellman, and Josie and the Pussycats.', 500, 6, 8),
(6, '5lbs Manhattan', 'Manhattan Publications', 'GRE5lbs.jpg', 'Practice book for GRE examinations.\r\nBest selling Book', 2000, 10, 6),
(7, 'The Big Sleep', 'Raymond Chandler', 'bigsleep.jpg', 'A dying millionaire hires private eye Philip Marlowe to handle the blackmailer of one of his two troublesome daughters, and Marlowe finds himself involved with more than extortion. Kidnapping, pornography, seduction, and murder are just a few of the complications he gets caught up in.', 1650, 12, 1),
(8, 'Murder on the Orient Express', 'Agatha Christie', 'motoe.jpg', 'The Queen of Mystery has come to Harper Collins! Agatha Christie, the acknowledged mistress of suspense—creator of indomitable sleuth Miss Marple, meticulous Belgian detective Hercule Poirot, and so many other unforgettable characters—brings her entire oeuvre of ingenious whodunits, locked room mysteries, and perplexing puzzles to Harper Paperbacks…including Murder on the Orient Express, the most famous Hercule Poirot mystery, which has the brilliant detective hunting for a killer aboard one of the world’s most luxurious passenger trains.', 800, 7, 1),
(9, 'Presumed Innocent', 'Scott Turow', 'PresumedInnocent.jpg', 'One of the best and most beloved in a long tradition of American courtroom novels.\"Presumed Innocent\" brings to life our worst nightmare: that of an ordinary citizen facing conviction for the most terrible of crimes. Prosecutor Rusty Sabich is transformed from accuser to accused when he is handed an explosive case--that of the brutal murder of a woman who happens to be his former lover.', 350, 0, 1),
(10, 'The Proposal', 'Jasmine Guillory', 'theproposal.jpg', 'You really can\'t go wrong with any of Jasmine Guillory\'s fun, romantic romps, but this Reese\'s Book Club pick is especially great. Freelance writer Nik\'s boyfriend proposes at a Dodger\'s game, and the dude can\'t even spell her name right. She says no (duh), and the video goes viral. Handsome doctor Carlos sweeps her away from the frenzy, but he can\'t possibly be the real deal. Or can he?', 1000, 5, 2),
(11, 'Jane Eyre', 'Charlotte Bronte', 'JaneEyre.jpg', 'This 1847 classic tells the tale of courageous governess and heroine Jane Eyre and her brooding employer with a terrible secret, Mr. Rochester. Groundbreaking for its time, the first-person narrative set a new standard for what romance could be — no wonder readers still love it more than 170 years later.', 600, 7, 2),
(12, 'The Notebook', 'Nicholas Sparks', 'Notebook.jpg', 'Every so often a love story so captures our hearts that it becomes more than a story -- it becomes an experience to remember forever. The Notebook is such a book. It is a celebration of how passion can be ageless and timeless, a tale that moves us to laughter and tears and makes us believe in true love all over again . . .\r\n\r\nAt thirty-one, Noah Calhoun, back in coastal North Carolina after World War II, is haunted by images of the girl he lost more than a decade earlier. At twenty-nine, socialite Allie Nelson is about to marry a wealthy lawyer, but she cannot stop thinking about the boy who long ago stole her heart. Thus begins the story of a love so enduring and deep it can turn tragedy into triumph, and may even have the power to create a miracle . . .', 2000, 8, 2),
(13, 'Bossypants', 'Tina Frey', 'Bossypants.jpg', 'Spirited and whip-smart, these laugh-out-loud autobiographical essays are \"a masterpiece\" from the Emmy Award-winning actress and comedy writer known for 30 Rock, Mean Girls, and SNL\" (Sunday Telegraph).\r\n\r\nBefore Liz Lemon, before \"Weekend Update,\" before \"Sarah Palin,\" Tina Fey was just a young girl with a dream: a recurring stress dream that she was being chased through a local airport by her middle-school gym teacher. She also had a dream that one day she would be a comedian on TV.\r\n\r\nShe has seen both these dreams come true.', 1400, 10, 8),
(14, 'Why Not Me', 'Mindy Kaling', 'whynotme.jpg', 'In Why Not Me?, Kaling shares her ongoing journey to find contentment and excitement in her adult life, whether it’s falling in love at work, seeking new friendships in lonely places, attempting to be the first person in history to lose weight without any behavior modification whatsoever, or most important, believing that you have a place in Hollywood when you’re constantly reminded that no one looks like you.', 1800, 3, 8),
(15, 'The Hunger Games', 'Suzanne Collins', 'HungerGames.jpg', 'In the ruins of a place once known as North America lies the nation of Panem, a shining Capitol surrounded by twelve outlying districts. The Capitol is harsh and cruel and keeps the districts in line by forcing them all to send one boy and one girl between the ages of twelve and eighteen to participate in the annual Hunger Games, a fight to the death on live TV.\r\n\r\nSixteen-year-old Katniss Everdeen, who lives alone with her mother and younger sister, regards it as a death sentence when she steps forward to take her sister\'s place in the Games. But Katniss has been close to dead before—and survival, for her, is second nature. Without really meaning to, she becomes a contender. But if she is to win, she will have to start making choices that weight survival against humanity and life against love.', 1500, 2, 3),
(16, 'Divergent', 'Veronica Roth', 'Divergent.jpg', 'In Beatrice Prior\'s dystopian Chicago world, society is divided into five factions, each dedicated to the cultivation of a particular virtue—Candor (the honest), Abnegation (the selfless), Dauntless (the brave), Amity (the peaceful), and Erudite (the intelligent). On an appointed day of every year, all sixteen-year-olds must select the faction to which they will devote the rest of their lives. For Beatrice, the decision is between staying with her family and being who she really is—she can\'t have both. So she makes a choice that surprises everyone, including herself.\r\n\r\nDuring the highly competitive initiation that follows, Beatrice renames herself Tris and struggles alongside her fellow initiates to live out the choice they have made. Together they must undergo extreme physical tests of endurance and intense psychological simulations, some with devastating consequences. As initiation transforms them all, Tris must determine who her friends really are—and where, exactly, a romance with a sometimes fascinating, sometimes exasperating boy fits into the life she\'s chosen. But Tris also has a secret, one she\'s kept hidden from everyone because she\'s been warned it can mean death. And as she discovers unrest and growing conflict that threaten to unravel her seemingly perfect society, she also learns that her secret might help her save those she loves . . . or it might destroy her.', 900, 10, 3),
(17, 'One Arranged Murder', 'Chetan Bhagat', 'CB.jpg', 'Ever since you found Prerna, I lost my best friend’ is what I told Saurabh.\r\nHi, this is Keshav, and Saurabh, my best friend, flatmate, colleague and business partner, won’t talk to me. Because I made fun of him and his fiancée.\r\nSaurabh and Prerna will be getting married soon. It is an arranged marriage. However, there is more cheesy romance between them than any love-marriage couple.\r\nOn Karva Chauth, she fasted for him. She didn’t eat all day. In the evening, she called him and waited on the terrace for the moon and for Saurabh to break her fast. Excited, Saurabh ran up the steps of her three-storey house. But when he reached …\r\nWelcome to One Arranged Murder, an unputdownable thriller from India’s highest-selling author. A story about love, friendship, family and crime, it will keep you entertained and hooked right till the end.', 150, 16, 3),
(18, 'Marvel Physics', 'Marvel Publications', 'marvelphysics.jpg', 'New latest edition 2017. - As per common core syllabus of NEET ( UG ) and JEE ( main ) - About 3750 MCQs - Hints and solutions for most of the MCQs - May 2016 papers with solutions.', 750, 20, 6),
(19, 'NCERT Fingertips', 'NCERT Publications', 'NCERTbio.jpg', 'Objective NCERT at your Fingertips - Biology, is an unparalleled book to let you learn NCERT at your fingertips. This book is designed as per the fact that most of the questions asked in PMTs are from Biology NCERT books (11th and 12th). It gives chapter-wise, student-friendly synopses for quick-and-easy revision of important concepts, topic-wise MCQs aligned with NCERT content to check your progress, Huge variety of MCQs extracted and derived from NCERT textbooks, HOTS MCQs and figure-based MCQs to boost concepts, NCERT exemplar MCQs, Assertion and Reason questions are included for an edge in your AIIMS preparation and 6 Practice Papers are given for self-assessment.', 650, 20, 6),
(20, 'Eating in the age of Dieting', 'Rujuta Diwekar', 'health.jpg', 'Rujuta Diwekar is amongst the most followed nutritionists globally, and a leading health advocate. Over the past decade, her writings have decisively shifted food conversations across the country away from fads and towards eating local, seasonal and traditional. Her mantra, ‘eat local, think global’, blends the wisdom of our grandmothers with the latest advances in nutrition science for sustainable good health for all.', 400, 2, 7);

